def _get_time_bins(self, ax):
    if not isinstance(ax, DatetimeIndex):
        raise TypeError(
            "axis must be a DatetimeIndex, but got "
            f"an instance of {type(ax).__name__}"
        )

    if len(ax) == 0:
        binner = labels = DatetimeIndex(data=[], freq=self.freq, name=ax.name)
        return binner, [], labels

    first, last = _get_timestamp_range_edges(
        ax.min(), ax.max(), self.freq, closed=self.closed, base=self.base
    )

    ax_values = ax.asi8
    binner, bin_edges = self._adjust_bin_edges(ax, ax_values)

    # handle ambiguous times
    tz = ax.tz
    ambiguous = "infer"
    if tz is not None and ambiguous == "infer":
        ambiguous = ax.inferred_tzinfo is not None

    start = ax[0]
    end = ax[-1]

    bins = lib.generate_bins_dt64(
        ax_values, bin_edges, self.closed, has_nans=ax.hasnans, ambiguous=ambiguous
    )

    labels = date_range(
        start=start,
        end=end,
        freq=self.freq,
        tz=ax.tz,
        name=ax.name,
        ambiguous=ambiguous,
        nonexistent="shift_forward",
    )

    if self.closed == "right":
        labels = labels[1:]
    if self.label == "right":
        labels = labels[1:]

    if ax.hasnans:
        binner = binner.insert(0, NaT)
        labels = labels.insert(0, NaT)

    if len(bin_edges) < len(labels):
        labels = labels[:len(bin_edges)]

    return binner, bins, labels
